const DeviceMaxLedLimit = 360;
var ChannelArray = [
    ["Channel 1", 90],
    ["Channel 2", 90],
    ["Channel 3", 90],
    ["Channel 4", 90],
];

function SetupChannels()
{
    device.SetLedLimit(DeviceMaxLedLimit);
    for(let i = 0; i < ChannelArray.length; i++)
	{
        device.addChannel(ChannelArray[i][0],ChannelArray[i][1]);
    }
}

const vKeyNames = [];
const vKeyPositions = [];

export function LedNames()
{
	return vKeyNames;
}

export function LedPositions()
{
	return vKeyPositions;
}

export function Initialize()
{
    SetupChannels()
}

export function Shutdown()
{
	SendChannel(0, true);
	device.pause(1);
	SendChannel(1, true);
	device.pause(1);
	SendChannel(2, true);
	device.pause(1);
	SendChannel(3, true);
	device.pause(1);
}

function SendChannel(Channel,shutdown = false)
{
    var ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount;

    var RGBData = [];
	if(shutdown)
	{
		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline", "RBG");
	}
    else if(LightingMode == "Forced")
	{
        RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline", "RBG");
    }
	else if(device.getLedCount() == 0)
	{
        ChannelLedCount = 90;
        var pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
        RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline", "RBG");
    }
	else
	{
        RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline", "RBG");
    }
	
	var offset = 0;
	var currPacket = 5;
	var shiftPackets = 4;
	
	var packet = new Array(365).fill(0);
	packet[0] = 0x0b;
	packet[1] = Channel;
	packet[2] = ChannelLedCount
	
	for(var LedIdx = 0; LedIdx < ChannelLedCount; LedIdx++)
	{
		offset = 5 + LedIdx + shiftPackets;
		packet[currPacket] = RGBData[currPacket-offset];
		packet[currPacket+1] = RGBData[currPacket+1-offset];
		packet[currPacket+2] = RGBData[currPacket+2-offset];
		currPacket += shiftPackets;
	}
	device.bulk_transfer(0x02, packet, 364);
}

export function Render()
{
	SendChannel(0);
	device.pause(1);
	SendChannel(1);
	device.pause(1);
	SendChannel(2);
	device.pause(1);
	SendChannel(3);
	device.pause(1);
}

